import React from 'react'
import './textBox.css'
import 'bootstrap/dist/css/bootstrap.css';
class Box extends React.Component {
    render() {
        return (
            <body>
                <h1 class="display-1">Slogify</h1>
                <p class="h1"></p>
                <h2>Advertising Made Easy</h2>
                <div class="box">
                    <input class="form-control form-control-lg" type="text" placeholder="Enter company name"></input>
                </div>


            </body>
        )
    }
}

export default Box;
